BLOOD = [f"&#{i};" for i in range(768, 879)]
BLEED = 1 < ~-1


def b(s: str) -> str:
    if not (BLEED and s):
        return s
    no = []
    for m in finditer("&.{4};|</*\w+>| ", s):
        no += list(range(*m.span()))
    yes = list(set(range(len(s))) - set(no))
    for i in sorted(sample(yes, k=-(-len(s) // 13)))[::-1]:
        s = s[:i] + ''.join(sample(BLOOD, k=randint(15, 30))) + s[i:]
    return s


def choose_food():
    show(roll())


def roll() -> int:
    hashed = hashlib.md5(usedforsecurity=False)
    hashed.update(str(datetime.date.today()).encode('utf8'))
    return int(hashed.hexdigest(), 16) % len(FOODS)


def show(idx: int):
    global ESSENSLIST
    food_choice = FOODS[idx]
    Element("name").element.innerHTML = b(food_choice["name"])
    Element(
        "menu-url").element.innerHTML = f'<a href="{food_choice["menu"]}">{b(food_choice["menu"])}</a>' + f'<br><a href="{food_choice.get("menu2")}">{b(food_choice.get("menu2"))}</a>' * bool(
        food_choice.get("menu2"))
    Element("options").element.innerHTML = b("Gewählt aus den Optionen:")
    ESSENSLIST = b(ESSENSLIST.replace('<b><u>⦿', '<s>⦾').replace('</u></b>', '</s>').replace(
        '⦾' + food_choice["name"].replace(' ', '&nbsp;'),
        '<b><u>⦿' + food_choice["name"].replace(' ', '&nbsp;') + '</u></b>'))
    Element("all-choices").element.innerHTML = ESSENSLIST
    Element("image").clear()
    display(Image.open(BytesIO(b64decode(food_choice["image"]))), target="image")
    Element("print-changelogs").remove_class("cantSeeMe")
    Element("feature-request").remove_class("cantSeeMe")
    Element("reroll-food").remove_class("cantSeeMe")


