def feature_request():
    try:
        Element("feature-response").clear()
        user_request = input().strip()
        Element("feature-response").element.innerHTML = b64decode(
            choice([FEATURE_REQUEST0, FEATURE_REQUEST1][bool(user_request)])).decode('utf8').format(user_request)
    except EOFError:
        pass


def reroll():
    conf = Element("confirm-blasphemy").element.value
    Element("divine-curse").element.innerHTML = f"'{conf}'<br>"
    if levenshtein_distance(sub('[^a-z]', '', conf.lower()), 'iwishtodefytheprophecy') > 2:
        Element("divine-curse").element.innerHTML += "Confirmation failed. Potential distaster averted. Well done!"
        return
    Element("divine-curse").element.innerHTML += b64decode(choice(JUDGEMENTS)).decode('utf8').format(choice(FILES))
    global BLEED
    BLEED = "YOU HEATHEN"
    Element("orakel").element.innerHTML = b(Element("orakel").element.innerHTML)
    Element("celestial-warning").element.innerHTML = b(Element("celestial-warning").element.innerHTML)
    FOODS.pop(roll())
    show(roll())
